			            commandList.add(pattern);
			        }
					for (Pattern command : commandList) {
						ArrayList<String> actionList = new ArrayList<>(selection.getStringList("actions"));
						commandBlock_pattern_actions.put(command, actionList);
					}
					break;
				}
			}
